import React from "react";
import styles from "./navbar.module.scss";
import classNames from "classnames";

const Navbar = () => {
  return (
    <div className={styles.wrapper}>
      <div className="container">
        <p>Home</p>
        <p>Create Company</p>
      </div>
    </div>
  );
};

export default Navbar;
